void sol() {
    // cin >> n;
    // cout << ans[n] << endl;
    // return;

    // cout << binary_search(all(prime), n) << ' ';

    if (n % 2 == 0 || n % 5 == 0 || n == 1) {
        cout << -1 << ", " << endl;
        return;
    }

    int tmp = 10;
    int ans = 0;
    while (tmp < n) {
        tmp *= 10;
        // ans++;
    }

    set<int> st;
    // st.insert(0);
    int m = n;

    while (!st.count(tmp % n)) {
        st.insert(tmp % n);
        ans++;
        tmp %= n;
        tmp *= 10;
    }
    cout << ans << ", " << endl;

    return;

    dp[m] = ans;
    // for (int j = 2; j < m; j++) if (m % j == 1) {
    //     cout << j << endl;
    //     return;
    // }

    // n = 28;
    // cin >> n;
    n = m;

    // cout << lowbit((n - 1)) << endl;

    // n -= 1;
    if (n == 0)
        return;

    int sum = 0;
    vector<int> v;
    for (int it: prime) {
        while (n % it == 0) {
            cout << it << ' ';
            // if (it != m)
                // sum += dp[it];
            v.pb(it);
            cmax(sum, dp[it]);
            n /= it;
        }
    }

    sort(all(v));
    v.erase(unique(all(v)), v.end());

    for (int i = 1; i < v.size(); i++) {
        int tmp = __gcd(v[i], v[i - 1]);
        v[i] /= tmp;
        v[i - 1] /= tmp;
        v[i] *= v[i - 1] / tmp;
    }


    cout << endl << sum << ' ' << v.back() << endl;;

}

